import { ForceGraph2D } from "react-force-graph";
import React, { useContext, useState, useEffect} from 'react';
import test from './datasets/test.json'
import vispubs from './datasets/vispubs.json'

function forceGraph() {
    let data = test
    console.log(data)


    var foci_points = {
        "Myriel": { x: 10, y: 10 },
        "Napoleon": { x: 10, y: 150 },
        "Mlle.Baptistine": { x: 10, y: 250 },
        "Mme.Magloire": { x: 20, y: 350 }
      };


    return (

        <>
        <ForceGraph2D
          graphData={data}
          foci_points={foci_points}
          nodeLabel="id"
          nodeAutoColorBy="group"
          linkVisibility ={0.1}
          onNodeDragEnd={node => {
            node.fx = node.x;
            node.fy = node.y;
            node.fz = node.z;
          }}
            />
        </>
      );
    }

    export default forceGraph;
